import React,{createContext} from 'react'




const global =createContext();
const Context = ({children}) => {
    let login=false;
    const LoggedIn=(user)=>{
      console.log(user)
    }
  return (
   <global.Provider value={{login,LoggedIn}}>
    {children}
   </global.Provider>
  )
}

export default Context
export {global}
